        <script>H5PIntegration = {"ajax":{"setFinished":"","contentUserData":""},"ajaxPath":"/h5p/ajax?action=","contents":{"cid-3647840648":{"displayOptions":{"copy":false,"copyright":true,"embed":false,"export":false,"frame":true,"icon":false},"fullScreen":"1","jsonContent":"{\"iconType\":\"image\",\"icon\":\"plus\",\"color\":\"#981d99\",\"hotspots\":[{\"position\":{\"x\":10.4,\"y\":12.901182432432432},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p>Para esta actividad vamos a necesitar:</p>\\n\\n<h3><strong>Materiales</strong></h3>\\n\\n<ul>\\n\\t<li>\\n\\t<p>1 placa protoboard.</p>\\n\\t</li>\\n\\t<li>\\n\\t<p>1 LED.</p>\\n\\t</li>\\n\\t<li>\\n\\t<p>1 resistencia (220 ohm o similar).</p>\\n\\t</li>\\n\\t<li>\\n\\t<p>1 pila (de 9V) con clip con cables.</p>\\n\\t</li>\\n\\t<li>\\n\\t<p>Cables de conexión (jumpers).</p>\\n\\t</li>\\n\\t<li>\\n\\t<p>Computadora con Fritzing (para ver el esquema).</p>\\n\\t</li>\\n</ul>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Texto\",\"license\":\"U\",\"title\":\"Sin título Texto\",\"authors\":[],\"changes\":[]},\"subContentId\":\"d8b49f95-a9a4-439a-a4d3-9856a4333a9c\"}]},{\"position\":{\"x\":11.200000000000001,\"y\":48.71199324324324},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p><strong>Observa el Esquema</strong></p>\\n\\n<ul>\\n\\t<li>\\n\\t<p>Con ayuda del docente, abre Fritzing y observa la imagen del circuito.</p>\\n\\t</li>\\n\\t<li>\\n\\t<p>Identifica cada componente: pila, LED, resistencia y cables.</p>\\n\\t</li>\\n</ul>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Texto\",\"license\":\"U\",\"title\":\"Sin título Texto\",\"authors\":[],\"changes\":[]},\"subContentId\":\"494ee0cb-a45e-409c-b229-2405cb3af22d\"}]},{\"position\":{\"x\":8.799999999999999,\"y\":66.69130067567568},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p><strong>Ubica los Componentes</strong></p>\\n\\n<ul>\\n\\t<li>\\n\\t<p>Coloca la <strong>pila</strong>, el <strong>LED</strong>, la <strong>resistencia</strong> y los cables sobre la mesa.</p>\\n\\t</li>\\n\\t<li>\\n\\t<p>Verifica que todos los materiales estén completos.</p>\\n\\t</li>\\n</ul>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Texto\",\"license\":\"U\",\"title\":\"Sin título Texto\",\"authors\":[],\"changes\":[]},\"subContentId\":\"f73d70a3-8340-4038-9fbe-3a5faf8665d2\"}]},{\"position\":{\"x\":24,\"y\":85.75802364864865},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p><strong>Coloca el LED</strong></p>\\n\\n<ul>\\n\\t<li>\\n\\t<p>Fíjate bien en las <strong>patas del LED</strong>:</p>\\n\\n\\t<ul>\\n\\t\\t<li>\\n\\t\\t<p>La <strong>pata larga</strong> es el <strong>ánodo</strong> (positivo).</p>\\n\\t\\t</li>\\n\\t\\t<li>\\n\\t\\t<p>La <strong>pata corta</strong> es el <strong>cátodo</strong> (negativo).</p>\\n\\t\\t</li>\\n\\t</ul>\\n\\t</li>\\n\\t<li>\\n\\t<p>Inserta el LED en la protoboard.</p>\\n\\t</li>\\n</ul>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Texto\",\"license\":\"U\",\"title\":\"Sin título Texto\",\"authors\":[],\"changes\":[]},\"subContentId\":\"b6a83f2f-51dc-42e5-9b88-5577e690ad97\"}]},{\"position\":{\"x\":57.99999999999999,\"y\":88.88302364864865},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p><strong>Conecta la Resistencia</strong></p>\\n\\n<ul>\\n\\t<li>\\n\\t<p>Coloca la resistencia conectando una pata del LED con uno de los cables que irá a la pila.</p>\\n\\t</li>\\n\\t<li>\\n\\t<p>Recuerda: la resistencia evita que el LED se queme.</p>\\n\\t</li>\\n</ul>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Texto\",\"license\":\"U\",\"title\":\"Sin título Texto\",\"authors\":[],\"changes\":[]},\"subContentId\":\"c1811b91-c309-43a3-a65e-997637e85d82\"}]},{\"position\":{\"x\":72,\"y\":85.37795608108108},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p><strong>Une los Cables</strong></p>\\n\\n<ul>\\n\\t<li>\\n\\t<p>Conecta el cable <strong>positivo</strong> de la pila (rojo) al <strong>ánodo</strong> (pata larga del LED).</p>\\n\\t</li>\\n\\t<li>\\n\\t<p>Conecta el cable <strong>negativo</strong> de la pila (negro) al <strong>cátodo</strong> (pata corta) a través de la resistencia.</p>\\n\\t</li>\\n</ul>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Texto\",\"license\":\"U\",\"title\":\"Sin título Texto\",\"authors\":[],\"changes\":[]},\"subContentId\":\"cb1e5f59-c06e-48f9-86cd-8d07e7cdfd38\"}]},{\"position\":{\"x\":90.8,\"y\":76.74197635135135},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p><strong>Verifica Todo</strong></p>\\n\\n<ul>\\n\\t<li>\\n\\t<p>Revisa que las conexiones coincidan con el esquema en Fritzing.</p>\\n\\t</li>\\n\\t<li>\\n\\t<p>Pide al docente que supervise antes de encender.</p>\\n\\t</li>\\n</ul>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Texto\",\"license\":\"U\",\"title\":\"Sin título Texto\",\"authors\":[],\"changes\":[]},\"subContentId\":\"80d78b8b-9843-452a-a80e-d7755c13d932\"}]},{\"position\":{\"x\":61.199999999999996,\"y\":41.75464527027027},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p><strong>¡Enciende!</strong></p>\\n\\n<ul>\\n\\t<li>\\n\\t<p>Coloca la pila y observa: ¡El LED debe encenderse!</p>\\n\\t</li>\\n\\t<li>\\n\\t<p>Si no se enciende, revisa la polaridad o las conexiones.</p>\\n\\t</li>\\n</ul>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Texto\",\"license\":\"U\",\"title\":\"Sin título Texto\",\"authors\":[],\"changes\":[]},\"subContentId\":\"5c124ddd-e818-4392-8bc9-dd3787a3285a\"}]}],\"hotspotNumberLabel\":\"Punto clave #num\",\"closeButtonLabel\":\"Cerrar\",\"containsAudioVideoLabel\":\"Contains Audio/Video\",\"image\":{\"path\":\"data:image/jpeg;base64,/9j/4AAQSkZJRgABAQAAAQABAAD/4gHYSUNDX1BST0ZJTEUAAQEAAAHIAAAAAAQwAABtbnRyUkdCIFhZWiAH4AABAAEAAAAAAABhY3NwAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAQAA9tYAAQAAAADTLQAAAAAAAAAAAAAAAAA
